import { lazy } from "react";
import styled from "styled-components";
import UnderConstruction from "../../content/UnderConstruction.json";

const Container = lazy(() => import("../../common/Container"));

const gifContainer = styled.div`
    display: flex;
    justify-content: center;
    margin-top: 2rem;
`

const UnderConstructionPage = () => {
    return (
        <Container padding="20% 15%" maxWidth="1700px">
            <Container>
            <h1 style={{ "color": "black" }}> {UnderConstruction.title} </h1>
            <p style={{ "color": "black" }}> {UnderConstruction.content} </p>
            </Container>
            <img src="/img/images/under-construction.gif" alt="cat-working-gif"/>
        </Container>
    )
}

export default UnderConstructionPage;
